export const selectReviewModule = (state) => state.reviews;

export const selectReviewById = (state, {reviewId}) => 
  selectReviewModule(state).entities[reviewId];

export const selectReviewsIds = (state) => 
  selectReviewModule(state).ids;

export const selectUserByReviewId = (state, {reviewId}) =>
  selectReviewModule(state).entities[reviewId].userId;
